import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [chores, setChores] = useState([]);

  useEffect(() => {
    const fetchChores = async () => {
      const result = await axios('http://localhost:8000/api/chores/');
      setChores(result.data);
    };

    fetchChores();
  }, []);

  return (
    <div>
      <h1>Chores</h1>
      {chores.map(chore => (
        <div key={chore.id}>
          <h2>{chore.title}</h2>
          <p>{chore.description}</p>
          <p>{chore.due_date}</p>
          <p>{chore.priority}</p>
          <p>{chore.status}</p>
        </div>
      ))}
    </div>
  );
}

export default App;
